std::random_device rd;

std::vector<int> functions::generate_TS(std::vector<std::vector<int>> all_distances){

    // List from 0 to all_distances.size - 1
    std::vector<int> intList {};
    for(int i = 0; i < all_distances.size(); i++){
        intList.push_back(i);
    }
    // resulting path and complete distance travelled
    std::vector<int> history {};
    // complete distance travelled
    int distance = 0;
    // starting point
    int index = 0;
    // travel to point
    int index2 = 0;
    int iteration = 0;
    int random_guy = 0;
    while(true) {
        // index is the origins from where we start our travel
        if(iteration == 0) {
            std::uniform_int_distribution<> dist(0, intList.size() - 1);
            random_guy = dist(rd);
            index = intList[random_guy];
            //std::cout << "Starting from " << index << std::endl;
            //std::cout << "Now deleting " << (intList.begin() + index) << std::endl;
            intList.erase(intList.begin() + random_guy);
            history.push_back(index);
        }
        else {
            index = index2;
        }

        // get a random element from the list
        std::uniform_int_distribution<> dist(0, intList.size() - 1);
        random_guy = dist(rd);
        // assign the destination to the second index
        index2 = intList[random_guy];
        //std::cout << "Now going " << index2 << std::endl;
        //std::cout << "Now deleting " << intList.begin() + index2 << std::endl;
        intList.erase(intList.begin() + random_guy);

        // for debug print the current distance
        //std::cout << "Going from " << index << " to " << index2 << " resulted in " << all_distances[index][index2] << " Kilometers" << std::endl;

        // adding current finished distance to the full distance
        distance += all_distances[index][index2];

        // add location index to the history
        history.push_back(index2);

        // checking if we travelled to all locations
        if(intList.empty()){
            break;
        }

        iteration++;
    }
    // add the final completed distance to the history vector at the end
    history.push_back(distance);

    // print out the last distance from index2 to 0 (going back to where we originally started)
    //std::cout << "Going from " << index2 << " to " << "0" << " resulted in " << all_distances[index2][0] << " Kilometers" << std::endl;

    //std::cout << "Travel distance was: " << distance << std::endl;

    return history;
}
